import React from "react";

class CaseStudyQuickshow extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="quickshow-wrapper">
        <p>{this.props.name} Case Study</p>
      </div>
    );
  }
}

export default CaseStudyQuickshow;
